export default class UsersList extends Component {
  constructor(props) {
    super(props);
    this.onChangeSearchAnswer = this.onChangeSearchAnswer.bind(this);

    this.state = {
    };
  }

  render() {
    return (
      <div>
        <div>
              <button
                className="btn"
                type="button"
                onClick={()=>history.push('/home')} >
                이동
              </button>
            </div>
          </div>
    );
  }
}
